import React from 'react';
import s from './ProfilInfo.module.css';
import Preloader from "../../../common/Preloader";
import ProfileStatus from "./ProfileStatus";

export type ProfilInfoPropsType = {
    profil: ProfilType
}

export type ProfilType = {
    status: string
    photos: {
        large: string
        small: string
    }
    aboutMe: string
    lookingForAJob: boolean
} | null


const ProfilInfo = (props: ProfilInfoPropsType) => {

    if (props.profil === null) {
        return <Preloader />
    }
    return (
        <div>
            <div>
                <img id={s.upimage} src='https://www.forestryservices.ie/wp-content/uploads/2019/05/color-conifer-daylight-1179229.jpg' />
            </div>
            <div className = {s.descriptionBlock}>
            <div>
                <img src={props.profil.photos.large} />
            </div>
                <ProfileStatus  status={'props.profil.status'}/>
                {props.profil.aboutMe}
                </div>
            <div> Job: {props.profil.lookingForAJob? 'looking for a job': 'Employed'}</div>
        </div>
    )
};

export default ProfilInfo;
